export default {
	CurrentUserId: () => { return 18 },
	GetUsersAverages: async () => {
		let users = await GetAllUsers.run();
		let averages = await GetAllAverages.run();
		return users.map(u => {
			u.Averages = averages.filter(a => a.UserId === u.Id);
			return u;
		});
	},
	GetUser: async (id) => { return (await Data.GetUsersAverages()).find(u => u.Id === id) },
	GetCurrentUser: async () => { return await Data.GetUser(Data.CurrentUserId()); },
	MatchingCountryUsers: async () => {
		let curr = await Data.GetCurrentUser();
		return (await Data.GetUsersAverages()).filter(u => u.Country === curr.Country && u.Id != curr.Id);
	},
}
